import Header from "./components/Header";
import Tasks from "./components/Tasks";
import React from "react";
import { useState } from "react";

function App() {
  const [tasks, setTasks] = useState([
    {
      id: 1,
      text: "Doc",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 2,
      text: "Dog",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 3,
      text: "Mom",
      day: "9.10.2010",
      reminder: false,
    },
  ]);

  const deleteTask = (id) => {
    setTasks(tasks.filter((task) => task.id != id));
  };
